    return (
        <TypewriterEffect options={{
            strings: ['Academics', 'Interests', 'Elevate your Passion', 
            'Career', 'Mind', 'Elevate your curiosity'],
            autoStart: true,
            loop: true,
            delay: 30,
            initString: props.initValue,
          }} />);
}




